import './App.css';
import Layout from './Layout'
import MyNavbar from './DumbComponents/Navbar/MyNavbar' 
import {Route} from 'react-router'

function App() {
  return (
    <div>
      <Route path="/" component={Layout} />
      <Route path='/' component={MyNavbar}/>
    </div>
  );
}

export default App;
